import React, { Component } from "react";

class SelectButton extends Component {
	state = {};
	render() {
		return (
			<React.Fragment>
				<li>
					<div className="collapsible-header">Order</div>
					<div className="col s12 m6">
						<div className="card white darken-4 ">
							<div className="card-content black-text">
								<p>
									{this.props.id + ": $" + this.props.price}
									<button
										className="btn-floating btn-small halfway-fab waves-effect waves-light red"
										onClick={this.handleClick.bind(this)}>
										<i
											className="material-icons"
											id={"checkmark_" + this.props.id}>
											add
										</i>
									</button>
								</p>
							</div>
						</div>
					</div>{" "}
				</li>
			</React.Fragment>
		);
	}
}

export default SelectButton;
